import React, { useState, useEffect, useCallback, useRef } from "react";
import "antd/dist/antd.css";
import { Link, Route, Switch, BrowserRouter as Router } from "react-router-dom";
import { Button } from "antd";
import { isAuthorized, userInfo } from "./Auth/AuthStore";

const Home = () => {
  useEffect(() => {
    console.log(isAuthorized);
  }, []);

  return (
    <>
      <h1>Home</h1>
      <p>Welcome home!</p>
      {isAuthorized ? (
        <Link to="/login">
          <Button>Login</Button>
        </Link>
      ) : (
        <span />
      )}
      {isAuthorized ? (
        <Button href="https://localhost:8080/oauth2/authorization/google">
          Login via Google
        </Button>
      ) : (
        <span />
      )}
      {!isAuthorized ? <div>안녕하세요 {userInfo.sub} 님</div> : <span />}
    </>
  );
};

export default Home;
